from collections import namedtuple
from time import time

Cell = namedtuple('Cell', ['value', 'horizontal_in_a_row', 'vertical_in_a_row'])


def maximal_rectangle(matrix: [[str]]) -> int:
    edge_case_triggered, edge_case_value = check_edge_cases(matrix)

    if edge_case_triggered:
        return edge_case_value

    rows = len(matrix)
    columns = len(matrix[0])

    dp = [[Cell._make([0, 0, 0]) for j in range(columns + 1)] for i in range(rows + 1)]

    for i in range(1, rows + 1):
        for j in range(1, columns + 1):
            top_cell = dp[i - 1][j]
            left_cell = dp[i][j - 1]

            top_value = matrix[i - 2][j - 1] if i >= 2 else '0'
            left_value = matrix[i - 1][j - 2] if j >= 2 else '0'

            if matrix[i - 1][j - 1] == '0':
                dp[i][j] = Cell._make([max(top_cell.value, left_cell.value), 0, 0])
            else:
                new_horizontal_in_a_row = 1
                new_vertical_in_a_row = 1
                new_value = 0

                if top_value == '0' and left_value == '0':
                    new_value = max(top_cell.value, left_cell.value, 1)

                if left_value == '1':
                    new_horizontal_in_a_row = left_cell.horizontal_in_a_row + 1

                if top_value == '1':
                    new_vertical_in_a_row = top_cell.vertical_in_a_row + 1

                if top_value == '1' and left_value == '1':
                    new_value = max(max_vertical_rectangle(dp, i, j, new_horizontal_in_a_row),
                                    max_horizontal_rectangle(dp, i, j, new_vertical_in_a_row))

                new_value = max(1, new_value,
                                new_horizontal_in_a_row, new_vertical_in_a_row,
                                top_cell.value, left_cell.value)

                dp[i][j] = Cell._make([new_value, new_horizontal_in_a_row, new_vertical_in_a_row])

    return dp[rows][columns].value


def max_vertical_rectangle(dp: [[Cell]], i: int, j: int, horizontal_in_a_row) -> int:
    sides = [dp[t_i][j].horizontal_in_a_row for t_i in range(i)]
    sides.append(horizontal_in_a_row)
    return get_max_rectangle(sides)


def max_horizontal_rectangle(dp: [[Cell]], i: int, j: int, vertical_in_a_row) -> int:
    sides = [dp[i][t_j].vertical_in_a_row for t_j in range(j)]
    sides.append(vertical_in_a_row)
    return get_max_rectangle(sides)


def get_max_rectangle(sides: [int]) -> int:
    stack = list()
    index = 0
    max_size = 0

    while index < len(sides):
        if not stack or sides[index] > sides[stack[-1]]:
            stack.append(index)
            index += 1
        else:
            top = stack.pop()
            multiplier = (index - stack[-1] - 1) if stack else index
            max_size = max(max_size, multiplier * sides[top])

    while stack:
        top = stack.pop()
        multiplier = (index - stack[-1] - 1) if stack else index
        max_size = max(max_size, multiplier * sides[top])

    return max_size


def check_edge_cases(matrix: [[str]]) -> [bool, int]:
    triggered = False
    value = 0

    if len(matrix) == 0 or len(matrix[0]) == 0:
        triggered = True
        value = 0

    elif len(matrix) < 2:
        cumulative = 0
        maximum = 0

        for i in range(len(matrix[0])):
            if matrix[0][i] == '1':
                cumulative += 1
                if cumulative > maximum:
                    maximum = cumulative
            else:
                cumulative = 0

        value = maximum

    return triggered, value


def show_matrix(matrix: [[Cell]]):
    for i in range(len(matrix)):
        line = ''
        for j in range(len(matrix[0])):
            line += f'{matrix[i][j].value} '
        print(line)


